import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl, { waitUntil: 'load' });

    // Set viewport to a mobile size to ensure the mobile menu is active
    await page.setViewportSize({ width: 375, height: 667 });

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial_mobile_view.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial_mobile_view.png'));

    // Step 2: Click the mobile menu trigger ("All" button)
    const menuTrigger = page.locator('div.nav-menu:has-text("All")');
    await menuTrigger.waitFor({ state: 'visible', timeout: 5000 });
    await menuTrigger.click();

    // Step 3: Wait for the mobile menu overlay to be visible
    const mobileMenuOverlay = page.locator('#mobileMenuOverlay');
    await mobileMenuOverlay.waitFor({ state: 'visible', timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_mobile_menu_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_mobile_menu_open.png'));

    // Step 4: Extract data from the mobile menu to verify it's open
    const menuHeader = await page.locator('.mobile-menu').first().innerText();
    const menuLinks = await page.locator('.mobile-menu a').allInnerTexts();
    const extractedData = {
      menuHeaderText: menuHeader.split('\n')[0].trim(), // Get "Browse Categories"
      firstFiveLinks: menuLinks.slice(0, 5)
    };

    // Step 5: Click the close button within the mobile menu
    const closeButton = page.locator('.mobile-menu button.close-mobile-menu').first();
    await closeButton.waitFor({ state: 'visible', timeout: 5000 });
    await closeButton.click();

    // Step 6: Wait for the mobile menu to be hidden
    await mobileMenuOverlay.waitFor({ state: 'hidden', timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_mobile_menu_closed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_mobile_menu_closed.png'));

    return {
      success: true,
      action: "Successfully opened and closed the mobile navigation menu.",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    // Take a screenshot on error
    const errorScreenshots = [];
    try {
      const errorScreenshotPath = path.join(screenshotsDir, 'error_screenshot.png');
      await page.screenshot({ path: errorScreenshotPath });
      errorScreenshots.push(errorScreenshotPath);
    } catch (e) {
      console.error("Failed to take error screenshot:", e);
    }

    return {
      success: false,
      action: "Failed to test mobile menu navigation",
      extractedData: {},
      screenshots: errorScreenshots,
      error: error.message
    };
  }
}
